import React, { Component } from "react";

class Form extends Component {
  render() {
    return (
      <div>
        <h1>Meus Formularios - Estados e React</h1>
        <form className="form">
          <label>
            Nome:
            <input type="text" name="name" />
          </label>
          <input type="submit" value="Enviar" />
        </form>
      </div>
    )
  }
}

export default Form
